import React from 'react';
import {BrowserRouter, Route, Switch } from 'react-router-dom';
import Header from './Header';



const App = () => {
    return (
        <div className="ui container">
            <BrowserRouter history = {history}>
            <div>
            <Header />
            </div>
        </BrowserRouter>
    </div>
    )}

export default App;
